def format_with_comma(value):
	if isinstance(value, (int, float)):
		return "{:,.4f}".format(value)
	return value

def format_with_comma2(value):
	if isinstance(value, (int, float)):
		return "{:,.2f}".format(value)
	return value

def format_with_comma3(value):
	if isinstance(value, (int, float)):
		return "{:,.0f}".format(value)
	return value

